import React from "react";
import ProductSimilarTemizlik from "../Components/product/ProductSimilarTemizlik";
import TemizlikSiviOnDaldirmaMaddesi from "../Components/product/TemizlikSiviOnDaldirmaMaddesi";

function TemizlikSiviOnDaldirmaMaddesiPage() {
  return (
    <>
      <TemizlikSiviOnDaldirmaMaddesi />
      <ProductSimilarTemizlik />
    </>
  );
}

export default TemizlikSiviOnDaldirmaMaddesiPage;
